    const navigate = useNavigate();

    const handleButtonClick = () => {
          navigate('/Brands');
          };

    return (
        <div> 
            <h1>Bienvenido al modo edici√≥n</h1>
            <div className='dash-container input'> 
            <input type="submit" value="Gestionar personas" onClick={() => handleButtonClick('Si')}/>
            <input type="submit" value="Gestionar productos" onClick={() => handleButtonClick(Sneakers)}/>
            </div>
            
        </div>
    );
};

export default Dashboard;
